import React from 'react';
import './styles.css';
import logo from './logo.svg'
import NavBar from './components/NavBar';
import { Navbar } from 'react-materialize' 

function App() {
  return (
    <div className="App">
      <Navbar 
        alignLinks="right"
        brand={logo}
      />
    </div>
  );
}

export default App;
